script: |
  super -f text -I q2452.spq | sort > q2452.out

inputs:
  - name: q2452.spq
    data: |
      SELECT DISTINCT col0 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + CAST ( NULL AS INTEGER ) * - + col2 NOT IN ( col2 * + col0 + + col2 * CAST ( NULL AS INTEGER ) );
  - name: tab2

outputs:
  - name: q2452.out
    data: |
